import React from 'react';
import './Person.css';

function Person() {
  return (
    <div className="colaborador">
      <div className="cabecalho">
        <img src="https://github.com/geavenx.png" alt="Vitor user" />
      </div>
      <div className="rodape">
        <h4>Vitor Donnangelo</h4>
        <h5>Aluno</h5>
      </div>
    </div>
  );
}

export default Person;
